function loadFbx(fbx) {
  let loadedMeshes = 0;
  let loadedSkeleton = 0;
  let loadedAnims = 0;
  const checkDone = function () {
    if (
      loadedMeshes === fbx.meshes.length &&
      loadedSkeleton === 1 &&
      loadedAnims === fbx.animations.length
    ) createFbx(fbx)
  };
  const loadMesh = function (model) {
    getFileNameContents(
      model.gr2,
      (dv) => {
        model.name = model.gr2.substr(model.gr2.lastIndexOf('/') + 1);
        model.geomId = String(Math.random()).substr(2, 13);
        model.modelId = String(Math.random()).substr(2, 13);
        model.meshes = [];
        const data = funcs.readFile[FILE_TYPE.GR2_GAWB](dv);
        for (let i = 0; i < data.meshes.length; i++) {
          const mesh = data.meshes[i];
          if (mesh.lod !== 0) continue;
          const meshOut = Object.create(null);
          meshOut.name = mesh.name;
          meshOut.id = String(Math.random()).substr(2, 8);
          meshOut.numVertices = mesh.numVertices;
          meshOut.numIndices = mesh.numIndices;
          let positions = '';
          let indices = '';
          let normals = '';
          let texCoords = '';
          let pos = 0;
          for (let j = 0; j < mesh.numVertices; j++) {
            if (mesh.bitFlag2 & 1) {
              if (j !== 0) positions += ',';
              positions += mesh.vb.getFloat32(pos, !0) * 1000 + ',';
              positions += mesh.vb.getFloat32(pos + 4, !0) * 1000 + ',';
              positions += mesh.vb.getFloat32(pos + 8, !0) * 1000;
              pos += 12
            }
            if (mesh.bitFlag2 & 256) {
              pos += 8
            }
            if (mesh.bitFlag2 & 2) {
              if (j !== 0) normals += ', ';
              normals += (mesh.vb.getUint8(pos) - 127) / 255 + ',';
              normals += (mesh.vb.getUint8(pos + 1) - 127) / 255 + ',';
              normals += (mesh.vb.getUint8(pos + 2) - 127) / 255 + ',';
              normals += (mesh.vb.getUint8(pos + 3) - 127) / 255;
              pos += 8
            }
            if (mesh.bitFlag2 & 16) {
              pos += 4
            }
            if (mesh.bitFlag2 & 32) {
              if (j !== 0) texCoords += ',';
              texCoords += readHalfFloat(mesh.vb.getUint16(pos, !0)) + ',';
              texCoords += readHalfFloat(mesh.vb.getUint16(pos + 2, !0));
              pos += 4
            }
            if (mesh.bitFlag2 & 64) {
              pos += 4
            }
            if (mesh.bitFlag2 & 128) {
              pos += 4
            }
          }
          for (let k = 0; k < mesh.numIndices; k++) {
            if (k !== 0) indices += ',';
            let val = mesh.ib.getUint16(k << 1, !0);
            if (k % 3 === 2) val ^= - 1;
            indices += val
          }
          if (positions !== '') meshOut.positions = positions;
          if (indices !== '') meshOut.indices = indices;
          if (normals !== '') meshOut.normals = normals;
          if (texCoords !== '') meshOut.texCoords = texCoords;
          model.meshes.push(meshOut)
        }
        loadedMeshes++;
        checkDone()
      },
      () => {
        loadedMeshes++;
        checkDone()
      },
    )
  };
  fbx.meshes.forEach(loadMesh);
  getFileNameContents(
    fbx.skeleton,
    (dv) => {
      const data = funcs.readFile[FILE_TYPE.GR2_SKELETON](dv);
      data.skeletonGr2 = data.bones.map(b => b.name);
      loadedSkeleton++;
      checkDone()
    },
    () => {
      loadedSkeleton++;
      checkDone()
    },
  );
  const loadAnimation = function (anim) {
    getFileNameContents(
      anim,
      (dv) => {
        loadedAnims++;
        checkDone()
      },
      () => {
        loadedAnims++;
        checkDone()
      },
    )
  };
  fbx.animations.forEach(loadAnimation)
};
