function file_bnk_media(data) {
  const frag = document.createDocumentFragment();
  addVolumeSlider(
    frag,
    0,
    1,
    0.05,
    0.3,
    !1,
    (newValue) => {
      data.gainNode44.gain.value = newValue;
      data.gainNode48.gain.value = newValue
    }
  );
  let stopper = () => {
  };
  let numPlayingAudio = 0;
  const playAudio = function () {
    const tr = this;
    this.dataset.audioPlaying = String((parseInt(this.dataset.audioPlaying) || 0) + 1);
    const buffer = ww2ogg(this.dataview);
    const audioCtx = tr.sampleRate === 44100 ? audioCtx44 : audioCtx48;
    const source = audioCtx.createBufferSource();
    audioCtx.decodeAudioData(
      buffer,
      function (buffer) {
        source.buffer = buffer;
        source.connect(tr.sampleRate === 44100 ? data.gainNode44 : data.gainNode48).connect(audioCtx.destination);
        source.start();
        if (numPlayingAudio === 0) data.startAudio();
        numPlayingAudio += 1;
        stopper();
        stopper = () => {
          source.stop();
          if (tr.dataset.audioPlaying === '1') {
            delete tr.dataset.audioPlaying
          } else {
            tr.dataset.audioPlaying = String((parseInt(tr.dataset.audioPlaying) || 0) - 1)
          }
          stopper = () => {
          }
        };
        source.onended = () => {
          numPlayingAudio -= 1;
          if (numPlayingAudio === 0) data.stopAudio()
        }
      },
      function (e) {
        console.log('Error with decoding audio data', e)
      }
    )
  };
  const p = document.createElement('p');
  p.innerHTML = '<mark>This SoundBank includes ' + Num.format(data.data.sections.DIDX.files.length) + ' audio files.</mark>';
  frag.appendChild(p);
  const table = document.createElement('table');
  table.className = 'nice';
  table.style.marginTop = '0.5em';
  const thead = document.createElement('thead');
  thead.innerHTML = '<tr><th>ID</th><th>Duration</th><th>File size</th><th colspan=2>Extract as</th></tr>';
  table.appendChild(thead);
  const tbody = document.createElement('tbody');
  for (let i = 0; i < data.data.sections.DIDX.files.length; i += 1) {
    const curFile = data.data.sections.DIDX.files[i];
    const durationCeil = Math.ceil(curFile.sampleCount / curFile.sampleRate);
    const tr = document.createElement('tr');
    const fileName = (data.file.path || '/resources/bnk2/') + 'streamed/' + curFile.id + '.wem';
    const fileRef = getFileFromName(fileName);
    if (fileRef) {
      tr.innerHTML = '<td><mark>' + curFile.id + '</mark><btn-open target="' + fileName + '" /></td><td>' + Math.floor(durationCeil / 60) + ':' + String(durationCeil % 60).padStart(2, '0') + '</td><td style="text-align:right;color:#777">' + formatBytes(curFile.size) + '</td><td style="color:#e9bd54" class="pointer">.wem</td><td></td>'
    } else {
      tr.dataview = curFile.dv;
      tr.sampleRate = curFile.sampleRate;
      tr.className = 'pointer';
      tr.innerHTML = '<td>' + curFile.id + '</td><td>' + Math.floor(durationCeil / 60) + ':' + String(durationCeil % 60).padStart(2, '0') + '</td><td style="text-align:right;color:#777">' + formatBytes(curFile.size) + '</td><td style="color:#e9bd54">.wem</td><td style="color:#e9bd54">.ogg</td>';
      tr.onclick = playAudio;
      tr.lastChild.onclick = function (event) {
        const buffer = ww2ogg(this.parentNode.dataview);
        const blob = new Blob([buffer]);
        downloadBlob(blob, curFile.id + '.ogg');
        event.stopPropagation()
      }
    }
    tr.childNodes[tr.childNodes.length - 2].onclick = function (event) {
      const blob = new Blob([this.parentNode.dataview]);
      downloadBlob(blob, curFile.id + '.wem');
      event.stopPropagation()
    };
    tbody.appendChild(tr)
  }
  table.appendChild(tbody);
  frag.appendChild(table);
  const mediaView = Object.create(null);
  mediaView.name = 'Media';
  mediaView.frag = frag;
  mediaView.open = () => {
  };
  mediaView.close = () => {
  };
  data.views.push(mediaView);
  data.defaultView = data.views.length - 1
};
