function parseFX(input) {
  const FX_KEYWORDS = [
    'bool',
    'float4x4',
    'float2',
    'float3',
    'float4',
    'float',
    'half2',
    'half3',
    'half4',
    'half',
    'int2',
    'int3',
    'int4',
    'int',
    'true',
    'false',
    'const',
    'shared',
    'struct',
    'return',
    'technique',
    'pass',
    'if',
    'else',
    'mul',
    'dot',
    'compile',
    'vs_3_0',
    'ps_3_0',
    'abs',
    'min',
    'max',
    'lerp',
    'sqrt',
    'rsqrt',
    'pow',
    'length',
    'saturate',
    'normalize',
    'reflect',
    'sampler2D',
    'sampler3D',
    'samplerCUBE',
    'tex2D',
    'tex3D',
    'texCUBE',
    'texCUBEbias',
  ];
  const FX_OPERATORS = [
    '+',
    '-',
    '*',
    '&lt;',
    '&gt;',
    '[',
    ']',
    '(',
    ')',
    '{',
    '}',
    ',',
    '.',
  ];
  const lines = input.split('\n');
  for (let i = 0; i < lines.length; i += 1) {
    const line = lines[i];
    const commentPos = line.indexOf('//');
    let code = commentPos === - 1 ? line : line.substring(0, commentPos);
    if (code.startsWith('#')) {
      code = '<span style="color:#e9bd54">' + code + '</span>'
    } else {
      code = code.replace(/([0-9]+\.[0-9]+f)/g, '<span style="color:lime">$1</span>');
      FX_KEYWORDS.forEach(
        (keyword) => {
          code = code.replaceAll(
            new RegExp('\\b' + keyword + '\\b', 'g'),
            '<span style="color:#e9bd54">' + keyword + '</span>'
          )
        }
      );
      FX_OPERATORS.forEach(
        (operator) => {
          code = code.replaceAll(operator, '<span style="color:#fff">' + operator + '</span>')
        }
      )
    }
    lines[i] = code + (
      commentPos === - 1 ? '' : '<span style="color:#777">' + line.substring(commentPos) + '</span>'
    )
  }
  return lines.join('\n')
};
