function gradientToEle(string, quadratic) {
  if (string.startsWith('#')) {
    string = '[0:' + string + ':L][1:' + string + ':L]'
  }
  const steps = Array.from(
    string.matchAll(
      /\[([01]?\.?[0-9]+):#([01]?\.?[0-9]+),([01]?\.?[0-9]+),([01]?\.?[0-9]+),([01]?\.?[0-9]+):(H|I|L|O|S|T|[A-Z])/g
    )
  ).map(
    ([_,
    percentage,
    r,
    g,
    b,
    a]) => 'rgba(' + Number(r) * 255 + ',' + Number(g) * 255 + ',' + Number(b) * 255 + ',' + a + ') ' + Number(percentage) * 100 + '%'
  ).join(', ');
  const span = document.createElement('span');
  span.style.display = 'inline-block';
  span.style.width = quadratic ? '1em' : '100px';
  span.style.height = '1em';
  span.style.background = 'linear-gradient(to left, ' + steps + ')';
  span.style.marginRight = '0.5em';
  return span
};
