        pos += 4;
        const idHi = dv.getUint32(pos, !0);
        pos += 4;
        id = uint64(idLo, idHi);
        const type = dv.getUint16(pos, !0);
        pos += 2;
        dataOffset = dv.getUint16(pos, !0);
        pos += 2
