funcs.readFile[FILE_TYPE.DEP] = function readDEP(dv) {
  const version = dv.getUint32(0, !0);
  assert(
    version === 1,
    'Expected version 1 in global.dep but it was ' + version
  );
  const out = {};
  out.numUnknown = dv.getUint32(4, !0);
  const numEntries = dv.getUint32(8, !0);
  const numTotalDependencies = dv.getUint32(12, !0);
  const numEntries2 = dv.getUint32(16, !0);
  assert(
    numEntries2 === numEntries,
    'Expected repeated entry count to match first count but it was ' + numEntries + ' and ' + numEntries2
  );
  let pos = 20;
  out.entries = [];
  let actualTotalDepencies = 0;
  for (let i = 0; i < numEntries; i += 1) {
    const sh = dv.getUint32(pos, !0);
    pos += 4;
    const ph = dv.getUint32(pos, !0);
    pos += 4;
    const numDependencies = dv.getUint16(pos, !0);
    pos += 2;
    actualTotalDepencies += numDependencies;
    const dependencies = [];
    for (let j = 0; j < numDependencies; j += 1) {
      const depSh = dv.getUint32(pos, !0);
      pos += 4;
      const depPh = dv.getUint32(pos, !0);
      pos += 4;
      dependencies.push({
        file: filesByHash[depSh + '|' + depPh],
        sh: depSh,
        ph: depPh,
      })
    }
    out.entries.push({
      file: filesByHash[sh + '|' + ph],
      sh,
      ph,
      dependencies,
    })
  }
  assert(
    actualTotalDepencies === numTotalDependencies,
    'Expected total dependencies to match data but it was ' + numTotalDependencies + ' and ' + actualTotalDepencies
  );
  return out
};
