    note.rotation = rotText.substr(1, rotText.length - 2).split(',').map((text) => parseFloat(text));
    const tags = fields[2].childNodes;
    note.tags = [];
    for (let j = 0, tagsl = tags.length; j < tagsl; j += 2) {
      note.tags.push(tags[j].innerHTML)
    }
    note.parentTags = fields[3].innerHTML.split(',').map(t => t.trim());
    note.showGhosted = fields[4].innerHTML === 'true';
    note.showOffmapArrow = fields[5].innerHTML === 'true';
    note.showQuestBreadcrumbOnly = fields[6].innerHTML === 'true';
    note.doNotBreadcrumb = fields[7].innerHTML === 'true';
    note.ignoreFoW = fields[8].innerHTML === 'true';
