function getBodyTypeFromFile(file) {
  if (file.name) {
    const matches = file.name.match(/^\/resources\/anim\/[a-z]+\/([a-z0-9_]+)\//);
    if (matches) return matches[1]
  } else {
    const archive = file.archive;
    for (let i = 0, il = archive.files.length; i < il; i++) {
      if (archive.files[i] === file) {
        const max = archive.files.length - 1;
        const maxDist = Math.max(i, max - i);
        for (let j = 1; j <= maxDist; j++) {
          if (i - j >= 0) {
            const archfile = archive.files[i - j];
            if (archfile.name) {
              const matches = archfile.name.match(/^\/resources\/anim\/[a-z]+\/([a-z0-9_]+)\//);
              if (matches) return matches[1]
            }
          }
          if (i + j <= max) {
            const archfile = archive.files[i + j];
            if (archfile.name) {
              const matches = archfile.name.match(/^\/resources\/anim\/[a-z]+\/([a-z0-9_]+)\//);
              if (matches) return matches[1]
            }
          }
        }
        break
      }
    }
  }
  return 'bfnnew'
};
