function getObjWriter(fileName, mesh, materials) {
  function getTextureOffsetFromBitflag(bitflag) {
    let textureOffset = 0;
    if (bitflag & 1) textureOffset += 12;
    if (bitflag & 256) textureOffset += 8;
    if (bitflag & 2) textureOffset += 8;
    if (bitflag & 16) textureOffset += 4;
    return textureOffset
  }
  return {
    write() {
      let out = '';
      out += '# Wavefront .obj 3D model file from Star Wars: The Old Republic\n';
      out += '# File name: ' + fileName + '\n';
      out += '# Mesh name: ' + mesh.name + '\n\n';
      if (materials.length > 0) {
        out += 'mtllib ' + materials.map((matName) => matName + '.mtl').join(' ') + '\n\n'
      }
      out += '# Vertices (with x/y/z coordinates):\n';
      for (let i = 0; i < mesh.numVertices; i += 1) {
        const x = 10 * mesh.vb.getFloat32(i * mesh.vertexSize, !0);
        const y = 10 * mesh.vb.getFloat32(i * mesh.vertexSize + 4, !0);
        const z = 10 * mesh.vb.getFloat32(i * mesh.vertexSize + 8, !0);
        out += 'v ' + x + ' ' + y + ' ' + z + '\n'
      }
      out += '\n';
      if (mesh.bitFlag2 & 32) {
        out += '# Texture coordinates (with u/v coordinates):\n';
        const textureOffset = getTextureOffsetFromBitflag(mesh.bitflag2);
        for (let i = 0; i < mesh.numVertices; i += 1) {
          const textureU = readHalfFloat(mesh.vb.getUint16(i * mesh.vertexSize + textureOffset, !0));
          const textureV = readHalfFloat(mesh.vb.getUint16(i * mesh.vertexSize + textureOffset + 2, !0));
          out += 'vt ' + textureU + ' ' + (1 - textureV) + '\n'
        }
        out += '\n'
      }
      out += '# Vertex indices (= faces):\n';
      out += 'o ' + mesh.name + '\n';
      mesh.subMeshes.forEach(
        function (submesh, index) {
          out += '  g submesh' + index + '\n';
          out += '  usemtl ' + materials[submesh.materialIndex] + '\n';
          for (let i = 0; i < submesh.numFaces; i += 1) {
            const position = submesh.startIndex + i * 3;
            const index1 = 1 + mesh.ib.getUint16(2 * position, !0);
            const index2 = 1 + mesh.ib.getUint16(2 * (position + 1), !0);
            const index3 = 1 + mesh.ib.getUint16(2 * (position + 2), !0);
            if (mesh.bitFlag2 & 32) {
              out += '  f ' + index1 + '/' + index1 + ' ' + index2 + '/' + index2 + ' ' + index3 + '/' + index3 + '\n'
            } else {
              out += '  f ' + index1 + ' ' + index2 + ' ' + index3 + '\n'
            }
          }
        }
      );
      return out
    },
  }
}
