function handleKeypress(evt) {
  switch (evt.key) {
    case 'Tab':
      {
        if (evt.ctrlKey) return !0;
        const pageKeys = getPageList();
        if (pageKeys.length < 2) return !1;
        if (!evt.shiftKey) {
          for (let i = 0; i < pageKeys.length; i++) {
            if (pageKeys[i] > pageOpen) {
              pages[pageKeys[i]].open();
              return !1
            }
          }
          pages[pageKeys[0]].open()
        } else {
          for (let i = pageKeys.length - 1; i >= 0; i--) {
            if (pageKeys[i] < pageOpen) {
              pages[pageKeys[i]].open();
              return !1
            }
          }
          pages[pageKeys[pageKeys.length - 1]].open()
        }
        return !1
      }
    case 'f':
    case 'F':
      if (evt.ctrlKey) {
        const curPage = pages[pageOpen];
        if (curPage) {
          const filter = curPage.page.querySelector('.filterArchives');
          if (filter) {
            filter.focus();
            evt.preventDefault();
            return !1
          }
        }
      }
      break;
    case 'w':
    case 'W':
      if (evt.shiftKey) {
        if (pages[pageOpen]) {
          pages[pageOpen].close()
        }
        return !1
      } else if (evt.altKey) {
        pageOpen = - 1;
        getPageList().forEach(index => {
          try {
            pages[index].close()
          } catch (e) {
            console.error(e)
          }
        });
        pagetabs_pagination();
        return !1
      }
      break;
    case 'o':
    case 'O':
      if (evt.ctrlKey) {
        evt.preventDefault();
        if (archives.length === 0) {
          document.getElementById('fileSelection').click()
        } else {
          openFileOrNodePrompt()
        }
        return !1
      }
      break;
    case 'F1':
      document.getElementById('navtabs').childNodes[0].onclick();
      evt.preventDefault();
      return !1;
    case 'F2':
      document.getElementById('navtabs').childNodes[1].onclick();
      evt.preventDefault();
      return !1;
    case 'F3':
      document.getElementById('navtabs').childNodes[2].onclick();
      evt.preventDefault();
      return !1;
    case 'F5':
      f5pressed = !0;
      return !0;
    default:
  }
}
