    canvas.addEventListener('contextmenu', (evt) => {
      evt.preventDefault()
    }, !1);
    canvas.addEventListener(
      'mousedown',
      function (event) {
        if (event.which === 1) dragging = !0;
        if (event.which === 3) moving = !0;
        lastX = event.pageX;
        lastY = event.pageY
      },
      !1
    );
