function getSkeleton(bodyType, callback) {
  bodyType = bodyType.toLowerCase();
  if (bodyType === 'battle') bodyType = 'battledroid';
  if (bodyType === 'battle_warbot_rakata_boss') bodyType = 'battlewarbotrakataboss';
  if (bodyType === 'slug') bodyType = 'klorslug';
  if (bodyType === 'slugboss') bodyType = 'klorslugboss';
  const file = getFileFromName('/resources/art/dynamic/spec/' + bodyType + '_skeleton.gr2');
  if (!file) return;
  getFileContents(
    file,
    (dv) => {
      const data = funcs.readFile[FILE_TYPE.GR2_SKELETON](dv);
      callback(data.bones)
    }
  )
};
function getFileChanger(dv) {
  const size = dv.byteLength;
  let pos = 0;
  const br = new DataView(new Uint8Array(size).buffer);
  const seek = (newPos) => {
    while (pos < newPos) {
      br.setUint8(pos, dv.getUint8(pos));
      pos += 1
    }
  };
  return {
    write8(newPos, val) {
      seek(newPos);
      br.setUint8(pos, val);
      pos += 1
    },
    write16(newPos, val) {
      seek(newPos);
      br.setUint16(pos, val, !0);
      pos += 2
    },
    write32(newPos, val) {
      seek(newPos);
      br.setUint32(pos, val, !0);
      pos += 4
    },
    writeFloat(newPos, val) {
      seek(newPos);
      br.setFloat32(pos, val, !0);
      pos += 4
    },
    done() {
      seek(size);
      let hex = '';
      for (let i = 0; i < size; i += 1) {
        let byteVal = br.getUint8(i);
        hex += hexChar[(byteVal >>> 4) & 15] + hexChar[byteVal & 15] + ' '
      }
      window.changedFile = hex
    },
  }
};
var WordFrequency = function () {
  this.words = Object.create(null);
  this.addText = function (text) {
    let wordBegin = 0;
    for (let i = 0; i < text.length; i++) {
      switch (text[i]) {
        case ',':
        case ';':
        case '.':
        case '!':
        case '?':
        case ' ':
        case '\n':
        case '"':
        case '&':
        case '*':
        case '-':
        case '(':
        case ')':
        case '[':
        case ']':
        case '{':
        case '}':
        case '<':
        case '>':
          if (wordBegin === i) {
            wordBegin++
          } else {
            const word = text.substring(wordBegin, i).toLowerCase();
            wordBegin = i + 1;
            if (this.words[word]) this.words[word]++;
             else this.words[word] = 1
          }
          break;
        default:
      }
    }
  };
  this.output = () => {
    const rebuiltArr = [];
    const keys = Object.keys(this.words);
    for (const key in keys) {
      rebuiltArr.push([keys[key],
      this.words[keys[key]]])
    }
    const sortedKeys = rebuiltArr.sort((a, b) => {
      if (a[1] < b[1]) return 1;
      if (a[1] > b[1]) return - 1;
      return 0
    });
    const sortedWords = [];
    for (let i = 0; i < sortedKeys.length; i++) {
      sortedWords.push(sortedKeys[i][0])
    }
    console.log(sortedWords)
  }
};
